import React from 'react';
import logo from '../../logo_catapulta.svg';
import { FaFacebookF, FaInstagram, FaYoutube, FaGithub } from "react-icons/fa";

import { Menu } from 'antd';

function AppFooter() {
    return (
        <div className="container-fluid">
            <div className="footer">
                <div className="logo">
                <a href="http://www.catapultadesign.com">           
                  <img src={logo} className="logo" alt="logo"/></a>
               </div>
               <ul className="social fas">
                   <li><a href="http://www.facebook.com"><FaFacebookF className="icon"/></a></li>
                   <li><a href="http://www.facebook.com"><FaInstagram className="icon"/></a></li>
                   <li><a href="http://www.facebook.com"><FaYoutube className="icon"/></a></li>
                   <li><a href="http://www.facebook.com"><FaGithub className="icon"/></a></li>
               </ul>
               <ul className="socials">
          <li><a href="https://www.facebook.com/"><i className="fab fa-facebook-f"></i></a></li>
          <li><a href="https://www.twitter.com/"><i className="fab fa-twitter"></i></a></li>
          <li><a href="https://www.linkedin.com/"><i className="fab fa-linkedin-in"></i></a></li>
          <li><a href="https://www.pinterest.com/"><i className="fab fa-pinterest-p"></i></a></li>
          <li><a href="https://www.instagram.com/"><i className="fab fa-instagram"></i></a></li>
        </ul>
               <div classNam="copyright">Copyright &copy; 2021 Catapulta</div>
            </div>
        </div>






    );
}

export default AppFooter;
